import data from "../data/discover_panel.json"
import {useState} from 'react'

function Discover()
{
    const [tag,setTag] = useState(data.ABOUT_US);

    return(
        <div className="discover">
            <div className="container image">
                <img src="./images/bali.jpg"/>
            </div>
            <div className="container info">
                <h2>Discover New Horizons</h2>
                <div className="tag-slider">
                    {Object.keys(data).map((key) => 
                    {
                        return(
                            <div key={key} className="slide">
                                <a>{key.split("_").join(" ")}</a>
                            </div>
                        );
                    })}

                </div>
                <p>Go Agency is committed to bringing our 
                clients the best in value and quality travel arrangements.
                 We are passionate about travel and sharing the world's wonders
                  with you.</p>
                <button>Read More</button>
            </div>
        </div>
    );
}



function About()
{


    return(
        <div className='about'>
            <Discover/>
        </div>
    );
}


export default About;
